import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Navbar from './layout/Navbar';
import Match from './pages/Match';
import Editmatch from './matches/Editmatch';
import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import Addmatch from './matches/Addmatch';
import Addteam from './teams/Addteam';
import Editteam from './teams/Editteam';
import Team from './pages/Team';
import Addpoints from './pointstable/Addpoints';
import Editpoints from './pointstable/Editpoints';
import Points from './pages/Points';
import Player from './pages/Player';
import Addplayer from './players/Addplayer';
import Editplayer from './players/Editplayer';
import Result from './pages/Result';
import Addresult from './results/Addresult';
import EditResult from './results/Editresult';
import Login from './pages/Login'; // Import the Login component

function PrivateRoute({ children }) {
  const auth = localStorage.getItem('auth');
  return auth === 'true' ? children : <Navigate to="/login" />;
}
function App() {
  return (
    <div className="App">
      <Router>
      <Navbar />
      <Routes>
      <Route exact path="/login" element={<Login />} />
        <Route exact path="/match" element={<Match/>}/>
        <Route exact path="/addmatch" element={<Addmatch/>}/>
        <Route exact path="/editmatch/:id" element={<Editmatch/>}/>
        <Route exact path="/team" element={<Team/>}/>
        <Route exact path="/addteam" element={<Addteam/>}/>
        <Route exact path="/editteam/:teamid" element={<Editteam/>}/>
        <Route exact path="/points" element={<Points/>}/>
        <Route exact path="/addpoints" element={<Addpoints/>}/>
        <Route exact path="/editpoints/:teamid" element={<Editpoints/>}/>
        <Route exact path="/player" element={<Player/>}/>
        <Route exact path="/addplayer" element={<Addplayer/>}/>
        <Route exact path="/editplayer/:playerid" element={<Editplayer/>}/>
        <Route exact path="/result" element={<Result/>}/>
        <Route exact path="/addresult" element={<Addresult/>}/>
        <Route exact path="/editresult/:matchid" element={<EditResult/>}/>

      </Routes>
      </Router>

    </div>
  );
}

export default App;
